import React from "react";

function GraphComponent() {
  const data = [
    { graphName: "John", stsName: 25 },
    { graphName: "Jane", stsName: 30 },
    { graphName: "Bob", stsName: 20 },
  ];

  const renderTableData = () => {
    return data.map((person, index) => {
      const { graphName, stsName } = person;

      let viewGraph = <button>View Graph</button>;
      let deleteGraph = <button>Delete Graph</button>;

      return (
        <tr key={index}>
          <td>{graphName}</td>
          <td>{stsName}</td>
          <td>
            {viewGraph} {deleteGraph}
          </td>
        </tr>
      );
    });
  };

  return (
    <div className="form">
      <table>
        <thead>
          <tr>
            <th bgcolor="#41afca">Graph Name</th>
            <th>STS Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>{renderTableData()}</tbody>
      </table>
    </div>
  );
}

export default GraphComponent;
